import React from 'react'
import 'semantic-ui/dist/semantic.min.css';
import '../Managerpg2/Managermain2.css'
import Empheader from './empheader'
import ManagerNav from "../Managerpg1/ManagerNav";
import ManagerFooter from "../Managerpg1/ManagerFooter";
import {BrowserRouter,Redirect} from "react-router-dom";
//import Managermain3 from "../Managerpg3/Managermain3"
import axios from 'axios'
import { Form, TextArea,Label ,Icon} from 'semantic-ui-react'
import apiconstants from '../employee/config';

class Empmain2 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            month:''

        }
    }


   setRedirect = async  (e) => {
        // event.preventDefault();
       // 
       //alert(this.state)
       await  this.setState({
            month:e
        })
        let id=this.props.match.params.id
        console.log('month',this.state)
     //   alert(this.state.month)
        const response = axios({
            method: 'patch',
            // url: 'http://192.168.1.245:8095/updatemonthvalue',
            url: apiconstants.URL+`updatemonthvalue/${id}/${this.state.month}`,
            // data: this.state
        })
        // .then(response=>{
        //      console.log(JSON.stringify(response.data))

        // }


        this.setState({
            redirect: true
        })


    }  

    setRedirect1 =(e) => {
        this.setState({
            redirect1: true
        })   
    }  



    render() {
        {
            if (this.state.redirect) {
                return <Redirect to={"/month-feedback" +"/"+ this.props.match.params.id+"/"+ this.props.match.params.emp  + "/" + this.state.month}/>;  
            }
        }

        {
            if (this.state.redirect1) {
                return <Redirect to={'/e/' + this.props.match.params.id}/>;

            }
        }
        return (
            <div className="manbg">
                 <Empheader idd={this.props.match.params.id} />


                <br/>
                <br/>
                <br/>
                <Label size='large' style={{color:"black",width :"auto"}} ><Icon name='user' />

     {this.props.match.params.emp}
    </Label> 
                <br/> <br/><br/>
<BrowserRouter>

    <nav>
          <div className="calender">
                <button onClick={(e)=>this.setRedirect('jan')} style={{margin:"30px"}} className="buttonGreen">JAN</button>
                <button onClick={(e)=>this.setRedirect('feb')} style={{margin:"30px"}} className="buttonGreen">FEB</button>
                <button onClick={(e)=>this.setRedirect('mar')} style={{margin:"30px"}} className="buttonGreen">MAR</button>
                <button onClick={(e)=>this.setRedirect('apr')} style={{margin:"30px"}} className="buttonGreen">APR</button>
                <button onClick={(e)=>this.setRedirect('may')} style={{margin:"30px"}} className="buttonGreen">MAY</button>
                <button onClick={(e)=>this.setRedirect('june')} style={{margin:"30px"}} className="buttonGreen">JUN</button> <br/>
                <button onClick={(e)=>this.setRedirect('july')} style={{margin:"30px"}} className="buttonGreen">JUL</button>
              <button onClick={(e)=>this.setRedirect('aug')} style={{margin:"30px"}} className="buttonGreen" >AUG  </button>
                <button onClick={(e)=>this.setRedirect('sep')} style={{margin:"30px"}} className="buttonGreen">SEPT</button>
                <button onClick={(e)=>this.setRedirect('oct')} style={{margin:"30px"}} className="buttonGreen">OCT</button>
                <button onClick={(e)=>this.setRedirect('nov')} style={{margin:"30px"}} className="buttonGreen">NOV</button>
                <button onClick={(e)=>this.setRedirect('december')} style={{margin:"30px"}} className="buttonGreen">DEC</button>
                <br/>
                <br/>
            </div>
    </nav>
</BrowserRouter>
                <br/>
                <br/>
                <br/>
                <button onClick={this.setRedirect1}
                            style={{ width :"auto",}}
                            className="ui blue button"> <Icon name="arrow circle left" /> Go Back</button>


<ManagerFooter/>
        </div>
        )
    }
}

